function initiate_lplus_creation(){var e=getElementsByClassName(document,"lplius-widget");if(e.length>0){if(LplusElements.css!==true){create_lplus_css();LplusElements.css=true}}for(var t=0;t<e.length;t++){LplusElements.elements[t]=e[t];parse_lplus_anchors(e[t],t)}}function create_lplus_css(){if(document.createStyleSheet){document.createStyleSheet(website_base_url+"valdiklis/style.css?v=2")}else{element=document.createElement("link");element.setAttribute("rel","stylesheet");element.setAttribute("type","text/css");element.setAttribute("href",website_base_url+"valdiklis/style.css?v=2");document.getElementsByTagName("head")[0].appendChild(element)}}function parse_lplus_anchors(e,t){var n=e.getAttribute("data-width")||250;var r=e.getAttribute("data-id");if(r==null)return;var i="id="+r+"&width="+n+"&element="+t;var s=document.createElement("script");s.setAttribute("src",website_base_url+"valdiklis/index.php?"+i);document.getElementsByTagName("head")[0].appendChild(s)}function create_lplus_widget(e){var t=document.createElement("div");var n=LplusElements.elements[e.element];t.setAttribute("class","lplius-widget-container");t.setAttribute("className","lplius-widget-container");t.setAttribute("style","width:"+(e.width-2)+"px");t.style["width"]=e.width-2+"px";t.innerHTML=e.data;n.parentNode.replaceChild(t,n)}function getElementsByClassName(e,t){if(e.getElementsByClassName){return e.getElementsByClassName(t)}else{return function(t,n){if(n==null)n=document;var r=[],i=n.getElementsByTagName("a"),s=i.length,o=new RegExp("(^|\\s)"+t+"(\\s|$)"),u,a;for(u=0,a=0;u<s;u++){if(o.test(i[u].className)){r[a]=i[u];a++}}return r}(t,e)}}var LplusElements={elements:new Array,css:false};window.onload=initiate_lplus_creation;